  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130678 includes physical
  and profile data collected aboard the NAVIGATION RESPONSE TEAM 7 during project
  S-N909-NRT3-10 in the Coastal Waters of SE Alaska on 2010-07-19. These data include
  CONDUCTIVITY, HYDROSTATIC PRESSURE, SALINITY, SOUND VELOCITY, WATER DENSITY and
